  constructor(props) {
    super(props);

    this.state = {
      data: []
    };
  }

  componentDidMount() {
    this.setState({ data: findUnits() });
  }
  render() {
    const { classes, match } = this.props;
    return (
      <div>
        <Header>this is unit page with id: {match.params.id}</Header>
      </div>
    );
  }
}

export default UnitPage;
